cs="CQN753DkFmHsmfcG78YtBP3dtB7s635HSwjt8CGQanbgab "

# wget https://www.comicbus.xyz/online/comic-9418.html?ch=328
# wget https://www.comicbus.com/html/9418.html

# id=9418
id=$1

chapter=$2
page=1

az="abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ"
indexOf(){
    sed 's/'$1'.*//g' <<< $az | wc -m
}

cl(){
    a=$(cut -c 1-1 <<< $1)
    b=$(cut -c 2-2 <<< $1)
    va=$(( $(indexOf $a) - 1 ))
    vb=$(( $(indexOf $b) - 1 ))
    
    # echo $(cut -c 41-42<<<$cc)

    if [[ $a == "Z" ]]; then
        vv=$((8000 + $vb))
    else
        vv=$(( $va * 52 + $vb ))
    fi
    echo $vv
}

for x in {1..328}; do
    mkdir $1 && cd $1;
    
page=1
pagef=$(printf "%03d\n" $page)

cStart=$(( ($chapter-1) * 46 + 1 ))
cEnd=$(( $chapter * 46 ))
cc=$(cut -c $cStart"-"$cEnd <<< $cs)

vStart=$(( ($page-1)/10%10 + ($page-1)%10*3 + 1 ))
vEnd=$(( $vStart + 2 ))

subfix=$(cut -c $vStart"-"$vEnd <<< $cc)


vv=$(cl $(cut -c 41-42<<<$cc))
va=$(cut -c 1-1 <<< $vv)
vb=$(cut -c 2-2 <<< $vv)

baseUrl='http://img'$va'.8comic.com/'$vb'/'$id'/'$chapter'/'$pagef'_'$subfix'.jpg'

pageCount=$(cl $(cut -c 43-44<<<$cc))


echo $baseUrl
echo $pageCount
